import ListrenderingJSX from './ListrenderingJSX'

function ListRendering() {
    const persons = [{
            id: 1,
            name: 'Ak',
            skill: 'React'
        },
        {
            id: 2,
            name:'Aj',
            skill:'Angular'
        }
    ]
    const personList = persons.map(person => <ListrenderingJSX person={person} />)
    return (
        <div>{personList}</div>
    )
}

export default ListRendering
